import React from "react";
import { Link } from "react-router-dom";

function SubjectList() {
  const subjects = [
    "Business Process Management",
    "Engineering Math",
    "Communication II",
    "Open Source SW",
    "Data Structure",
    "Computer System"
  ];

  return (
    <div>
      <h1>과목 목록</h1>
      <ul>
        {subjects.map((subject, index) => (
          <li key={index}>
            <Link to={`/board/${subject.toLowerCase().replace(/ /g, "-")}`}>
              {subject}
            </Link>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default SubjectList;
